function App() {
  const title = 'Blog post';
  const body = 'This is my blog post';
  const comment = [
    { id: 1, text: 'Comment One' },
    { id: 2, text: 'Comment Two' },
    { id: 3, text: 'Comment Three' },
  ];
  const isloading = false;
  const show=<tr></tr>;
  if (isloading) return  <h1>loadding....</h1>;
  return (
    <div>
      <h1>{title}</h1>
      <p>{body}</p>
      {show ? (<div className='comment'>
        <h3>comment({comment.length})</h3>
        <ul>
          {comment.map((item) => (
            <li>{item.text}</li>
          ))}
        </ul>
      </div>):(<></>)}
      
    </div>
  );
}
export default App;
